import logo from './logo.svg';
import './App.css';
import { Router } from 'express';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Define the routes */}
        <Router>
          {/* Registration route */}
          <Router path="/register" element={<Register />} />

          {/* Login route */}
          <Router path="/login" element={<Login />} />

          {/* User Dashboard */}
          <Router path="/user-dashboard" element={<UserDashboard />} />

          {/* Ground Owner Dashboard */}
          <Router path="/groundowner-dashboard" element={<GroundOwnerDashboard />} />

          {/* Redirect to register by default */}
          <Router path="/" element={<Register />} />
        </Router>
      </div>
    </Router>
  );
}

export default App;
